// Generated by Mochi transpiler
dynamic _substr(dynamic s, num start, num end) {
  int n = s.length;
  int s0 = start.toInt();
  int e0 = end.toInt();
  if (s0 < 0) s0 += n;
  if (e0 < 0) e0 += n;
  if (s0 < 0) s0 = 0;
  if (s0 > n) s0 = n;
  if (e0 < 0) e0 = 0;
  if (e0 > n) e0 = n;
  if (s0 > e0) s0 = e0;
  if (s is String) {
    return s.substring(s0, e0);
  }
  return s.sublist(s0, e0);
}


Never _error(String msg) {
  throw Exception(msg);
}

double fabs(double x) {
  if (x < 0.0) {
    return -x;
  } else {
    return x;
  }
}

double reynolds_number(double density, double velocity, double diameter, double viscosity) {
  if (density <= 0.0 || diameter <= 0.0 || viscosity <= 0.0) {
    _error("please ensure that density, diameter and viscosity are positive");
  }
  return density * fabs(velocity) * diameter / viscosity;
}

void main() {
  print(reynolds_number(900.0, 2.5, 0.05, 0.4));
  print(reynolds_number(450.0, 3.86, 0.078, 0.23));
  print(reynolds_number(234.0, -4.5, 0.3, 0.44));
}
